        <p>I have experience with ReactJS, mySQL, MongoDB, HTML, CSS, JS, JQuery, Express, Bootstrap, JSON, APIs, and AJAX. </p>
        <p>My dream is to one day start my own business building websites.</p>
        </div>
    );

}

export default About;
